schemaDefinition: "create or replace view SURVIVOR_ACCT_BU_ROLLING_CACV_DC_PQ(\n\t\
  \"SurvivorOptyAcctNumber\",\n\t\"SurAcctBURollingCACVDCPQ\",\n\t\"OptySalesQuarter\"\
  ,\n\t\"SurAcctBURollingCACVDC\",\n\t\"SurAcctBURollingCACV\",\n\t\"ProductBusinessUnitValue\"\
  \n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"SurvivorOptyAcctNumber\" as \"SurvivorOptyAcctNumber\"\
  , --\"SurAcctBURollingCACVDC\"-\"FinNNACVDC_CC1\" as \"SurAcctBURollingCACVDCPQ\"\
  \n\"SurAcctBURollingCACVDCPQ\" as \"SurAcctBURollingCACVDCPQ\",\n              \
  \                                                                              \
  \                                          \"OptySalesQuarter\" as \"OptySalesQuarter\"\
  ,\n                                                                            \
  \                                                          \"SurAcctBURollingCACVDC\"\
  \ as \"SurAcctBURollingCACVDC\",\n                                             \
  \                                                                              \
  \           \"SurAcctBURollingCACV\" as \"SurAcctBURollingCACV\",\n            \
  \                                                                              \
  \                                            \"ProductBusinessUnitValue\" as \"\
  ProductBusinessUnitValue\"\nFROM\n  (SELECT \"SurvivorOptyAcctNumber\" as \"SurvivorOptyAcctNumber\"\
  ,\n          MAX(\"FinNNACVDC_CC\") as \"FinNNACVDC_CC1\",\n          \"OptySalesQuarter\"\
  \ as \"OptySalesQuarter\",\n          SUM(\"FinNNACVDC_CC_1\") as \"SurAcctBURollingCACVDC\"\
  ,\n          SUM(\"FinNNACV_CC\") as \"FinNNACV_CC\",\n          SUM(\"FinNNACV_CC_1\"\
  ) as \"SurAcctBURollingCACV\",\n          \"ProductBusinessUnitValue\" as \"ProductBusinessUnitValue\"\
  ,\n          SUM(\"FinNNACVDC_CC_1\")-IFNULL(\"FinNNACVDC_CC1\", 'random') as \"\
  SurAcctBURollingCACVDCPQ\"\n   FROM\n     (SELECT \"OptySalesQuarter\" as \"OptySalesQuarter\"\
  ,\n             \"FinNNACVDC_CC\" as \"FinNNACVDC_CC\",\n             \"SurvivorOptyAcctNumber\"\
  \ as \"SurvivorOptyAcctNumber\",\n             \"OptySalesQuarter_1\" as \"OptySalesQuarter_1\"\
  ,\n             \"FinNNACVDC_CC_1\" as \"FinNNACVDC_CC_1\",\n             \"FinNNACV_CC\"\
  \ as \"FinNNACV_CC\",\n             \"FinNNACV_CC_1\" as \"FinNNACV_CC_1\",\n  \
  \           \"ProductBusinessUnitValue\" as \"ProductBusinessUnitValue\"\n     \
  \ FROM\n        (SELECT \"Aggregation_3\".\"SurvivorOptyAcctNumber\" as \"SurvivorOptyAcctNumber\"\
  ,\n                \"Aggregation_1\".\"FinNNACVDC_CC\" as \"FinNNACVDC_CC\",\n \
  \               \"Aggregation_1\".\"OptySalesQuarter\" as \"OptySalesQuarter\",\n\
  \                \"Aggregation_3\".\"OptySalesQuarter\" as \"OptySalesQuarter_1\"\
  ,\n                \"Aggregation_3\".\"FinNNACVDC_CC\" as \"FinNNACVDC_CC_1\",\n\
  \                \"Aggregation_1\".\"FinNNACV_CC\" as \"FinNNACV_CC\",\n       \
  \         \"Aggregation_3\".\"FinNNACV_CC\" as \"FinNNACV_CC_1\",\n            \
  \    \"Aggregation_3\".\"ProductBusinessUnitValue\" as \"ProductBusinessUnitValue\"\
  \n         FROM\n           (SELECT \"SurvivorOptyAcctNumber\" as \"SurvivorOptyAcctNumber\"\
  ,\n                   SUM(\"FinNNACVDC_CC\") as \"FinNNACVDC_CC\",\n           \
  \        \"OptySalesQuarter\" as \"OptySalesQuarter\",\n                   SUM(\"\
  FinNNACV_CC\") as \"FinNNACV_CC\",\n                   \"ProductBusinessUnitValue\"\
  \ as \"ProductBusinessUnitValue\"\n            FROM\n              (SELECT \"SurvivorOptyAcctNumber\"\
  \ as \"SurvivorOptyAcctNumber\",\n                      \"FinNNACVDC_CC\" as \"\
  FinNNACVDC_CC\",\n                      \"OptySalesQuarter\" as \"OptySalesQuarter\"\
  ,\n                      \"FinNNACV_CC\" as \"FinNNACV_CC\",\n                 \
  \     \"ProductBusinessUnitValue\" as \"ProductBusinessUnitValue\"\n           \
  \    FROM \"CDL_LS\".\"PRODUCT_RPT\".\"SURVIVOR_OPP_ACCOUNT\")\"Projection_9\"\n\
  \            GROUP BY \"SurvivorOptyAcctNumber\",\n                     \"OptySalesQuarter\"\
  ,\n                     \"ProductBusinessUnitValue\")\"Aggregation_1\"\n       \
  \  INNER JOIN\n           (SELECT \"SurvivorOptyAcctNumber\" as \"SurvivorOptyAcctNumber\"\
  ,\n                   \"OptySalesQuarter\" as \"OptySalesQuarter\",\n          \
  \         SUM(\"FinNNACVDC_CC\") as \"FinNNACVDC_CC\",\n                   SUM(\"\
  FinNNACV_CC\") as \"FinNNACV_CC\",\n                   \"ProductBusinessUnitValue\"\
  \ as \"ProductBusinessUnitValue\"\n            FROM\n              (SELECT \"SurvivorOptyAcctNumber\"\
  \ as \"SurvivorOptyAcctNumber\",\n                      \"OptySalesQuarter\" as\
  \ \"OptySalesQuarter\",\n                      \"FinNNACVDC_CC\" as \"FinNNACVDC_CC\"\
  ,\n                      \"FinNNACV_CC\" as \"FinNNACV_CC\",\n                 \
  \     \"ProductBusinessUnitValue\" as \"ProductBusinessUnitValue\"\n           \
  \    FROM \"CDL_LS\".\"PRODUCT_RPT\".\"SURVIVOR_OPP_ACCOUNT\")\"Projection_2\"\n\
  \            GROUP BY \"SurvivorOptyAcctNumber\",\n                     \"OptySalesQuarter\"\
  ,\n                     \"ProductBusinessUnitValue\")\"Aggregation_3\" ON \"Aggregation_1\"\
  .\"SurvivorOptyAcctNumber\" = \"Aggregation_3\".\"SurvivorOptyAcctNumber\"\n   \
  \      AND \"Aggregation_1\".\"ProductBusinessUnitValue\" = \"Aggregation_3\".\"\
  ProductBusinessUnitValue\")\"Join_1\"\n      WHERE \"OptySalesQuarter_1\" <= \"\
  OptySalesQuarter\")\"Projection_1\"\n   GROUP BY \"SurvivorOptyAcctNumber\",\n \
  \           \"OptySalesQuarter\",\n            \"ProductBusinessUnitValue\")Aggregation_2;"
